import React from 'react';
import './App.css';
import logo from './main-logo.png';

import Header from './components/Header'

import Button from '@mui/material/Button';


function App() {
  return (
    <div className="App">
      <Header />
        <img src={logo} alt="mainlogo" />
      <div>
      <Button variant="contained">Hello World</Button>
      </div>
    </div>
  );
}

export default App;
